_type":"markdown","id":"d6e52a06","metadata":{"papermill":{"duration":0.152515,"end_time":"2022-02-21T22:54:38.045642","exception":false,"start_time":"2022-02-21T22:54:37.893127","status":"completed"},"tags":[]},"source":["With this graph we can clearly see that June, July, August and September are the months with more rides, and January, February, November and December are the months with the least rides. \n","It's important to notice that from September to October, the number of casual rides decreases to less than half."]},{"cell_type":"markdown","id":"ddec8f4b","metadata":{"papermill":{"duration":0.150896,"end_time":"2022-02-21T22:54:38.347652","exception":false,"start_time":"2022-02-21T22:54:38.196756","status":"completed"},"tags":[]},"source":["# **Recommendations on Findings**\n","\n","* Since we found out that most of the casual riders prefer to use Cyclistic services in the weekends, the marketing strategy should focus on help casual riders realize the benefits of using its services midweek.\n","* February is the lowest month in annual member rides, maybe discounts or special offers should be considered there.\n","* Casual riders like to take long leasiure rides, marketing should try and capitalize on this fact on it's marketing campaign."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":92.537617,"end_time":"2022-02-21T22:54:38.709084","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-02-21T22:53:06.171467","version":"2.3.3"}},"nbformat":4,"nbformat_minor":5}